
Tepsiju veličine 20x30cm premazati uljem. Kore izrezati na veličinu tepsije (u mom slučaju kore prepoloviti). Orahe i prezlo izmješati. Najprije redati u tepsiju 3 kore svaku premazati uljem (s cetkicom). Četvrtu posuti mješavinom oraha i prezle (odprilike 3-4 kašike) petu premazati uljem. Tako redati do kraja, jednu premazati uljem, sljedeću posuti orasima dok se ne potroši sav materijal. Na kraju 3 kore premazati samo uljem kao na početku. Ostaviti sa strane još jednu koru. Baklavu isjeći dijagonalno na rombove. Zagrijati 125ml ulja i 125g maslaca te preliti preko isječene baklave. Na baklavu staviti jednu cijelu koru koju smo ostavili sa strane kako nebi izgorila.Baklava se peče 50min. Zagrijati rernu na 200C. Prvih 10 minuta peći na 200C. Smanjiti na 180C pa peći idućih 30 minuta na 180C. Na kraju pečenja ponovo pojačati temperaturu na 200C pa peći još 10 minuta.Izvaditi iz rerne, skinuti gornju koru (koja je malo izgorila) i preliti hladnim zaljevom. Kada upije zaljev mozete poklopiti drugom tepsijom 10-ak minuta da stoji kako se nebi gornja kora dizala. Ostaviti da se hladi na sobnoj temperaturi, pa prebaciti u frižider pokrivenu aluminijskom folijom. Baklava može dugo stajati u frižideru, ali nestat ce u trenu. U slast!', 1, 1, 'https://upload.wikimedia.org/wikipedia/commons/c/c7/Baklava%281%29.png');


